import React, {Component} from "react";
import { format } from "date-fns";
import { connect } from "react-redux";


import { retrieveCustomer ,retrieveCustomers} from "../../../store/customer_slice";
import { retrieveInvoice, retrieveInvoices } from "../../../store/invoice_slice";
import { findOrderLineByOrderID, retrieveOrderLines } from "../../../store/orderline_slice";
import { retrieveOrder, retrieveOrders } from "../../../store/order_slice";


class OrderCard extends Component {
	constructor(props) {
	  super(props);

	  this.handleOnClick = this.handleOnClick.bind(this);
	  this.getCustomerData = this.getCustomerData.bind(this);
	  this.getInvoiceData = this.getInvoiceData.bind(this);
	  this.findOrderLinesByID = this.findOrderLinesByID.bind(this);
	  this.refreshUser = this.refreshUser.bind(this);

	  this.state = {
		tabData: {
			order: {
				referenceNumber: "",
				customerID: 0,
			},
			customer: {
				customerID: "",
				firstName: "",
				lastName:"",
				phoneNumber: "",
				email: "",
			}, 
			invoice: {
				invoiceNumber: "NA"
			},
			orderline: [
				{
					lineOrderId: 0,
					lineProductId: 0,
					qtyOrdered:0,
				}
			]
		}
	 };
	}

	handleOnClick(tabData) {
		this.props.orderCardOnClick(tabData)
	}

	// This gets the users when the component loads
	componentDidMount() {

		this.getCustomerData(this.props.order.customerId, this.props.order)

		.then(()=> {
			this.findOrderLinesByID(this.props.order.orderID);
		})

	}

	getCustomerData(id, order) {
		this.props
			.retrieveCustomer({id})
			.then((data) => {
				console.log(data);
				this.setState({
					tabData: {
						order: order,
						customer: {
							customerID: data.payload.customerID,
							firstName: data.payload.firstName,
							lastName: data.payload.lastName,
							phoneNumber: data.payload.phoneNumber,
							email: data.payload.email,
						} 
					}

					});
					this.getInvoiceData(this.props.order.orderID);
				})
			.catch((e) => {
			console.log(e);
			});
	}

	getInvoiceData(id) {

		this.props
			.retrieveInvoice({id})
			.then((data) => {
				console.log(data);
				this.setState({
					tabData: {
						invoice: {
							orderID: data.payload.orderID,
							invoiceNumber: data.payload.invoiceNumber || 'NA',
							revenue: data.payload.revenue,
							expense: data.payload.expense,
							isPaid: data.payload.isPaid

						} 
					}

				  });
			  })
			.catch((e) => {
			console.log(e);
			});

	}

	findOrderLinesByID(id) {
		this.props.findOrderLineByOrderID({ id });
	}

	refreshUser() {
		this.setState({
			tabData: {
				order: {
					referenceNumber: "",
					customerID: 0,
				},
				customer: {
					customerID: "",
					firstName: "",
					lastName:"",
					phoneNumber: "",
					email: "",
				}, 
				invoice: {
					invoiceNumber: "NA"
				},
				orderline: [
					{
						lineOrderId: 0,
						lineProductId: 0,
						qtyOrdered:0,
					}
				]	
			}
		});
	  }

	render() {
		const {order, customers, orderline, invoices} = this.props;
		console.log(order);
		console.log(customers);
		console.log(orderline);
		console.log(invoices);


		const {tabData} = this.state;
		console.log(tabData);


		var numberOfLogs = 0;
		// order.productsOrdered.forEach(product => numberOfLogs+= product.quantity)		
		var datePlaced = new Date(order.datePlaced);



		return (
			<div className='OrderCard' onClick={() => this.handleOnClick(tabData)}>


				<div className='OrderCardHeader' style={{ backgroundColor: this.props.color }}>
					<h4 style={{ fontWeight: 'bold' }}>{tabData.customer.lastName}, {tabData.customer.firstName}</h4>
					<h4 style={{float: 'right'}}>Placed: {format(datePlaced, "MM-dd-yy")}</h4>
				</div>

				<div className='OrderCardContent'>
					<h4>Reference: {order.referenceNumber}</h4>
					{/* <h4>Invoice: {(tabData.invoice.invoiceNumber === undefined) ? 'NA' : tabData.invoice.invoiceNumber}</h4> */}
					<h4>Logs Ordered: {numberOfLogs}</h4>
				</div>	
			</div>
		);	
	}
  }


  // Mapping only the parts of the redux store that we want to work with on this component
  const mapStateToProps = (state) => {	

	return {
		customers: state.customers,
		invoices: state.invoices,
		orderline: state.orderline
	};
  };

export default connect(mapStateToProps, { retrieveOrder, retrieveCustomers, retrieveOrders, retrieveOrderLines,retrieveInvoices, retrieveCustomer, findOrderLineByOrderID, retrieveInvoice })(OrderCard);
